import ComingSoonBanner from './components/ComingSoonBanner';
import Hero from './components/Hero';
import Categories from './components/Categories';
import AgeFilter from './components/AgeFilter';
import NauriBot from './components/NauriBot';

function App() {
  return (
    <div>
      {/* Announcement or limited-time promo */}
      <ComingSoonBanner />

      {/* Hero section with intro message or call to action */}
      <Hero />

      {/* Show product categories */}
      <Categories />

      {/* Optional: help users narrow down by age */}
      <AgeFilter />

      {/* Smart assistant / chatbot â€” should stay fixed or appear floating */}
      <NauriBot />
    </div>
  );
}

export default App;
